import React,{useState} from "react";
import Nav from "./Navbar";
import validate from './validateInfo';
import {Link} from 'react-router-dom';
import useForm from './useForm';


const Register = ({ submitForm }) => {
    const { handleChange , postUser , user , errors } = useForm(
        submitForm,
        validate
    );

    return (
        <div className='form-content-right'>

          <form onSubmit={postUser} className='form' noValidate>
        
            <div className='form-inputs'>
              <label className='form-label'>firstName</label>
              <input
                className='form-input'
                type='text'
                name='firstName'
                placeholder='Enter your firstName'
                value={user.firstNmae}
                onChange={handleChange}
              />
              {errors.firstName && <p>{errors.firstName}</p>}
            </div>

            <div className='form-inputs'>
              <label className='form-label'>lastName</label>
              <input
                className='form-input'
                type='text'
                name='lastName'
                placeholder='Enter your lastName'
                value={user.lastName}
                onChange={handleChange}
              />
              {errors.lastName && <p>{errors.lastName}</p>}
            </div>

            <div className='form-inputs'>
              <label className='form-label'>Email</label>
              <input
                className='form-input'
                type='email'
                name='emailId'
                placeholder='Enter your email'
                value={user.emailId}
                onChange={handleChange}
              />
              {errors.emailId && <p>{errors.emailId}</p>}
            </div>


            <div className='form-inputs'>
              <label className='form-label'>Phone Number </label>
              <input
                className='form-input'
                type='text'
                name='mobileNo'
                placeholder='Enter your Phone Number'
                value={user.mobileNo}
                onChange={handleChange}
              />
              {errors.mobileNo && <p>{errors.mobileNo}</p>}
            </div>


            <div className='form-inputs'>
              <label className='form-label'>Password</label>
              <input
                className='form-input'
                type='password'
                name='password'
                placeholder='Enter your password'
                value={user.password}
                onChange={handleChange}
              />
              {errors.password && <p>{errors.password}</p>}
            </div>

            <div className='form-inputs'>
              <label className='form-label'>Confirm Password</label>
              <input
                className='form-input'
                type='password'
                name='cfpwd'
                placeholder='Confirm your password'
                value={user.cfpwd}
                onChange={handleChange}
              />
              {errors.cfpwd && <p>{errors.cfpwd}</p>}
            </div>

            <button className='form-input-btn' type='submit'>
              Sign up
            </button>
            <span className='form-input-login'>
              Already have an account? Login <a href='Login'>here</a>
            </span>
          </form>
        </div>
      );
    };
export default Register;
